import React, { useState } from "react";
import "./App.css";
import Form from "./components/Form";
import NoteList from "./components/NoteList";

function App(props) {
  const [inputTitle, setInputTitle] = useState(props.edit ? props.edit.value : '');
  const [inputText, setInputText] = useState(props.edit ? props.edit.value : '');
  const [notes, setNotes] = useState([]);

  return (
    <div className="App">
      <Form
        inputTitle={inputTitle}
        inputText={inputText}
        notes={notes}
        setNotes={setNotes}
        setInputTitle={setInputTitle}
        setInputText={setInputText}
      />
      <NoteList 
        setNotes={setNotes}
        notes={notes}
        title={notes.title}
        text={notes.text}
        date={notes.date}
      />
    </div>
  );
}

export default App;
